On dbus unpack failure, we shouldn't do anything other than return an internal error.  I suspect what you meant to do was:

bool available = true;
if (checkAvailable == nullptr){
   available = *checkAvailable;
}
getState(...., available);

should be
```
if (!success){
   internalError();
   return;
}

if (checkAvailable != nullptr){
    available = *checkAvailable;
}
```

As written, you're possibly dereferencing a null pointer.
